import React from 'react'

const Modal = ({title,author}) => {
  return (
    <><button type="button" class="btn btn-primary" data-toggle="modal" data-target="#exampleModal">View</button><div class="modal fade" id="exampleModal" tabindex="-1" role="dialog" aria-labelledby="exampleModalLabel" aria-hidden="true"><div class="modal-dialog" role="document">    <div class="modal-content">    <div class="modal-header">        <h5 class="modal-title" id="exampleModalLabel">Details</h5>        <button type="button" class="close" data-dismiss="modal" aria-label="Close">        <span aria-hidden="true">&times;</span>        </button>    </div>    <div class="modal-body">        <p>{title}</p>        <p>{author}</p>    </div>    <div class="modal-footer">        <button type="button" class="btn btn-secondary" data-dismiss="modal">Close</button>        {/* <button type="button" class="btn btn-primary">Save changes</button> */}    </div>    </div></div></div>
    </>
  )
}

export default Modal
